<p><code>history</code>命令用于显示用户之前在命令行中执行过的命令历史记录。这个功能非常有用，可以帮助用户快速查找和重新执行之前使用过的命令，从而提高工作效率。在大多数Linux系统中，命令历史记录存储在用户主目录下的<code>.bash_history</code>文件中。</p>
