<p><code>wget</code>是一个在Linux系统中用于从网络上下载文件的命令行工具。它支持HTTP、HTTPS和FTP协议，可以在非交互式环境下工作，这意味着它可以在用户退出系统后继续在后台运行下载任务。<code>wget</code>因其稳定性和强大的功能而广受欢迎，即使在网络不稳定的情况下也能可靠地完成下载任务。</p>
